import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import "./styles.css";

// Заглушки для игр с кнопкой возврата
const BackButton = () => (
  <Link to="/" className="back-button">⬅ Назад</Link>
);

const TicTacToe = () => (
  <div className="game-container">
    <BackButton />
    <h2 className="text-xl font-semibold">Крестики-нолики (в разработке)</h2>
  </div>
);

const RockPaperScissors = () => (
  <div className="game-container">
    <BackButton />
    <h2 className="text-xl font-semibold">Камень, ножницы, бумага (в разработке)</h2>
  </div>
);

const MemoryGame = () => (
  <div className="game-container">
    <BackButton />
    <h2 className="text-xl font-semibold">Игра на память (в разработке)</h2>
  </div>
);

const ReactionGame = () => (
  <div className="game-container">
    <BackButton />
    <h2 className="text-xl font-semibold">Игра на реакцию (в разработке)</h2>
  </div>
);

const Home = () => {
  const [isFirstVisit, setIsFirstVisit] = useState(false);

  useEffect(() => {
    const visited = localStorage.getItem("visited");
    if (!visited) {
      setIsFirstVisit(true);
      localStorage.setItem("visited", "true");
    }
  }, []);

  return (
    <div className="container">
      {isFirstVisit && (
        <div className="welcome-message">
          <h2>Добро пожаловать в Мини-игровой хаб! 🎮</h2>
          <p>Выбирайте игру и наслаждайтесь!</p>
        </div>
      )}
      <h1>🎮 Мини-игровой хаб</h1>
      <nav className="nav-links">
        <Link to="/tic-tac-toe">Крестики-нолики</Link>
        <Link to="/rock-paper-scissors">Камень, ножницы, бумага</Link>
        <Link to="/memory-game">Игра на память</Link>
        <Link to="/reaction-game">Игра на реакцию</Link>
      </nav>
    </div>
  );
};

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/tic-tac-toe" element={<TicTacToe />} />
        <Route path="/rock-paper-scissors" element={<RockPaperScissors />} />
        <Route path="/memory-game" element={<MemoryGame />} />
        <Route path="/reaction-game" element={<ReactionGame />} />
      </Routes>
    </Router>
  );
};

export default App;
